import './Dialogs.css';
import {NavLink} from "react-router-dom";

const ListDialogs = (props) => {
	return (
		<li className='item_dialogs'>
			<NavLink className="item_dialogs__link" to="">
				<div className="item_dialogs__content">{props.name}</div>
			</NavLink>
		</li>
	)
}

export default ListDialogs;
